import "../../../index.css";
export default function RegistrationClicked() {
    return (
        <div style={{ display: "flex" }}>
                <button className="select_button_Container"
                style={{
                    marginLeft: "312px",
                    cursor: "pointer",
                    backgroundColor: "#4BAB26", // 클릭시 배경색 초록 state써서 onclick
                    color: "#FFFFFF", // 클릭시 글자색 흰색
                    fontSize:"13px",
                }}>
                시스템 이용법
            </button>
            <button className="select_button_Container"
                style={{
                    marginLeft:"2px",
                    cursor: "pointer",
                    fontSize:"13px",
                }}>
                수강 시뮬레이션
            </button>
            <button className="select_button_Container"
                style={{
                    marginLeft:"2px",
                    cursor: "pointer",
                    backgroundColor: "#4BAB26", // 클릭시 배경색 초록 state써서 onclick
                    color: "#FFFFFF", // 클릭시 글자색 흰색
                    fontSize:"13px",
                }}>
                개설과목 조회
            </button>

            <button className="select_button_Container"
                style={{
                    marginLeft:"2px",
                    cursor: "pointer",
                    backgroundColor: "#4BAB26", // 클릭시 배경색 초록 state써서 onclick
                    color: "#FFFFFF", // 클릭시 글자색 흰색
                    fontSize:"13px",
                }}>
                개인
            </button>
            <div style={{    
            borderBottom: "1px solid black",
            lineHeight: "0.1em",
                width:"1180px",
                marginLeft: "312px",
                }}/>
        </div>
    );
}
